import React, { useState, useEffect } from 'react';
import './User.css';

const User = () => {
  const [data, setData] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://localhost:3001/api/currents');
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        const result = await response.json();
        setData(result);
      } catch (error) {
        console.error('Error fetching JSON data:', error.message);
        setError('Error fetching data. Please try again later.');
      }
    };

    fetchData();
  }, []);

  const tableHeader = ['Base Station', 'Users'];

  return (
    <div>
      <center>
        <div>
          {error ? (
            <p>{error}</p>
          ) : (
            <table className="table mb-0" style={{ /* your table styles */ }}>
              <thead>
                <tr>
                  {tableHeader.map((header, index) => (
                    <th key={index} className="border-gray-200" style={{ /* your th styles */ }}>
                      {header}
                    </th>
                  ))}
                </tr>
              </thead>
              <tbody>
                {data.map((row, rowIndex) => (
                  <tr key={rowIndex}>
                    {tableHeader.map((header, headerIndex) => (
                      <td key={headerIndex} style={{ /* your td styles */ }}>
                        {Array.isArray(row[header]) ? row[header].join(', ') : row[header]}
                      </td>
                    ))}
                  </tr>
                ))}
              </tbody>
            </table>
          )}
        </div>
      </center>
    </div>
  );
};

export default User;
